class TaskHolder extends Component {

  viewArticle = () => {
    this.props.toggleNews()
    this.props.setCurrentNews(this.props.article)
    console.log("hello")
  }

  render(){
    return (
    <div>
    hello
    </div>
    )
  }
}

export default TaskHolder
